  return "<h2>Help</h2>\n\n<h3>Legend</h3>\n<p><i class=\"legend-icon icon-check-empty\"></i> Item are un-checked</p>\n<p><i class=\"legend-icon icon-check\"></i> Item are checked</p>\n<p><i class=\"legend-icon icon-star-empty\"></i> Item rating (1 to 3 stars)</p>\n<!--\n<p><i class=\"legend-icon icon-lock\"></i> Item are currently vaulted</p>\n-->\n<p><i class=\"legend-icon icon-attention\"></i> Item are unobtainable</p>\n<p><i class=\"legend-icon icon-puzzle\"></i> Item are a component (save this item in your Inventory)</p>\n<p><i class=\"legend-icon icon-link-ext\"></i> External link, will open in a new tab</p>\n<!--\n<p><span class=\"legend-color legend-vaulted\"></span> Item are vaulted</p>\n<p><span class=\"legend-color legend-unobtainable\"></span> Item are unobtainable</p>\n-->\n\n<p><img src=\"include/images/legend-v3.png\" id=\"legend-image\" alt=\"Site legend\"></p>\n\n<h3>Useful links</h3>\n<ul>\n    <li><a href=\"http://www.warframe.com/droptables\" target=\"_blank\">Official Drop Table &amp; Locations for Relics</a></li>\n    <li><a href=\"https://www.cephalonwannab.com/\" target=\"_blank\">Tier List - Ranking of all weapons</a></li>\n    <li><a href=\"https://overframe.gg/\" target=\"_blank\">Overframe.gg - Best site for builds</a></li>\n    <li><a href=\"https://warframe.fandom.com/wiki/Mastery_Rank\" target=\"_blank\">Wikia - Info about mastery rank</a></li>\n</ul>\n\n<h3>Notes</h3>\n<h5>Why are 6 items missing?</h5>\n<p>The 6 missing items are the Modular Kitgun chambers that are both considered primary and secondary depending on what\ngrip you build them with:</p>\n<ul>\n<li><a href=\"https://warframe.fandom.com/wiki/Rattleguts\" target=\"_blank\">Rattleguts</a></li>\n<li><a href=\"https://warframe.fandom.com/wiki/Catchmoon\" target=\"_blank\">Catchmoon</a></li>\n<li><a href=\"https://warframe.fandom.com/wiki/Gaze\" target=\"_blank\">Gaze</a></li>\n<li><a href=\"https://warframe.fandom.com/wiki/Sporelacer\" target=\"_blank\">Sporelacer</a></li>\n<li><a href=\"https://warframe.fandom.com/wiki/Tombfinger\" target=\"_blank\">Tombfinger</a></li>\n<li><a href=\"https://warframe.fandom.com/wiki/Vermisplicer\" target=\"_blank\">Vermisplicer</a></li>\n</ul>\n<p>Digital Extremes made the decision to list the chambers as both Primary &amp; Secondary in in-game menu My profile >\nEquipment.</p>\n<p>Once the chamber are Gilded (independent on grip) that chamber will be marked in-game as completed for both Primary &amp;\nSecondary.</p>\n\n<h5>Unobtainable items</h5>\n<p>Three items are considered \"Unobtainable\" since they were only accessible from the <a href=\"https://warframe.fandom.com/wiki/Founders\" target=\"_blank\">Founder Packages</a> and are removed from this app:</p>\n<ul>\n    <li><a href=\"https://warframe.fandom.com/wiki/Excalibur_Prime\" target=\"_blank\">Excalibur Prime</a></li>\n    <li><a href=\"https://warframe.fandom.com/wiki/Lato_Prime\" target=\"_blank\">Lato Prime</a></li>\n    <li><a href=\"https://warframe.fandom.com/wiki/Skana_Prime\" target=\"_blank\">Skana Prime</a></li>\n</ul>\n\n<h5>Fully ranked items</h5>\n<p>Two items comes fully ranked and will add to mastery once obtained:</p>\n<ul>\n    <li><a href=\"https://warframe.fandom.com/wiki/Excalibur_Umbra\" target=\"_blank\">Excalibur Umbra</a></li>\n    <li><a href=\"https://warframe.fandom.com/wiki/Skiajati\" target=\"_blank\">Skiajati</a></li>\n</ul>\n\n<h5>Unique items</h5>\n<p><a href=\"https://warframe.fandom.com/wiki/Khora\" target=\"_blank\">Khora's</a> companion Venari will grant 6000 points towards mastery rank.</p>\n<p><a href=\"https://warframe.fandom.com/wiki/Plexus\" target=\"_blank\">Railjack's Plexus</a> will contribute to Mastery rank, adding 6000 points when fully ranked.</p>\n<p>Several items can reach level 40 and grant an additional 1000 points:</p>\n<ul id=\"help-modal-unique-items-list\">\n"
    + ((stack1 = lookupProperty(helpers,"each").call(alias1,(depth0 != null ? lookupProperty(depth0,"array") : depth0),{"name":"each","hash":{},"fn":container.program(1, data, 0),"inverse":container.noop,"data":data,"loc":{"start":{"line":65,"column":4},"end":{"line":69,"column":13}}})) != null ? stack1 : "")
    + "</ul>\n\n<h3>I'm MR-32, what do I do?</h3>\n<p>Checkmark all items by typing this in browser console:</p>\n<p><code>app.item.checkAll()</code></p>\n<p>Logout and login to flush the local storage</p>\n<p>Search for 'Login reward' and check those items</p>\n<p>Search for 'Kuva' and check all items obtained from Kuva Liches</p>\n<p>Search for 'Tenet' and check all items obtained from Sisters of Parvos</p>\n<p>Open Stats and check all categories against in-game menu if the numbers don't add up</p>\n\n<h3>Functions</h3>\n<p>Check all items</p>\n<p><code>app.item.checkAll()</code></p>\n<p>Uncheck all items</p>\n<p><code>app.item.unCheckAll()</code></p>\n<p>Copy data for checked items to clipboard (Works for Chrome):</p>\n<p><code>copy(app.storage.list())</code></p>\n<p>Import data</p>\n<p><code>app.import.showModal()</code></p>\n<p>Export data</p>\n<p><code>app.export.showModal()</code></p>\n<p>Download CSV</p>\n<p><code>app.export.csv()</code></p>\n\n<h3>About this app</h3>\n<p>UX, frontend &amp; backend by <a href=\"https://andersbrandt.se/\">Anders Brandt</a></p>\n<p>Item data are supplied by <a href=\"https://github.com/WFCD/\" target=\"_blank\">Warframe Community Developers</a> repo\n    <a href=\"https://github.com/WFCD/warframe-items/\" target=\"_blank\">warframe-items</a>, thank you guys!</p>\n<p>Tier-list are supplied by <a href=\"https://www.cephalonwannab.com/\" target=\"_blank\">i_wanna_b_the_guy's Tier List</a>\n</p>\n<p>\n    <b>Data fetched:</b><br />\n    "
