    + "\n</p>\n\n<h3>Privacy</h3>\n<p>We will not store any personal information. Login are delegated to Google using <a target=\"_blank\" href=\"https://developers.google.com/api-client-library/\">Google API Client</a></p>\n<p>The only data we store are your <a target=\"_blank\" href=\"https://www.google.com/search?q=what%27s+my+google+id\">numerical public Google ID</a>. Your ID is used in a obfuscated format in this app.</p>\n<p>Your firstname (displayed in user-menu) are stored in session only, and never stored in database or on disk.</p>\n<p><b>We will not send you emails or store your email-address.</b></p>\n\n<a class=\"close-reveal-modal\" aria-label=\"Close\">&#215;</a>\n\n<div class=\"text-right\">\n    <button type=\"button\" class=\"btn btn-default action-close-modal\">Close</button>\n</div>\n";
